&lt;li&gt;采用了 &lt;code&gt;.*&lt;/code&gt;  来匹配任何字符，使得过滤的关键字不用完全一致，只要有相应的字符顺序就行，中间可以穿插任意字符：如 &lt;code&gt;.*c.*a.*t.*&lt;/code&gt;  可以与 &lt;code&gt;c1a2t3&lt;/code&gt;  匹配可利用 &lt;code&gt;?&lt;/code&gt;  来进行绕过：&lt;/li&gt;
&lt;li&gt;同时 cat 被过滤，想要用通配符 &lt;code&gt;?&lt;/code&gt;  必须要唯一确定一个命令，因此需要完整路径来保证是唯一路径： &lt;code&gt;/bin/cat&lt;/code&gt; =&amp;gt; &lt;code&gt;/bin/ca?&lt;/code&gt;&lt;/li&gt;
