&lt;p&gt;过滤了字母，导致不能通过常规方法传入系统命令，可以通过 &lt;code&gt;无数字、字母命令执行&lt;/code&gt; 来绕过：&lt;/p&gt;
&lt;h4 id=&#34;利用方法&#34;&gt;&lt;a class=&#34;anchor&#34; href=&#34;#利用方法&#34;&gt;#&lt;/a&gt; 利用方法:&lt;/h4&gt;
