也就是说，本题设置了 open_basedir，将 php 所能打开的文件限制在指定的目录树中，包括文件本身。因为 ini_set () 也被限制了，所以 &lt;code&gt;open_basedir&lt;/code&gt;  不能用 &lt;code&gt;ini_set&lt;/code&gt;  重新设置绕过。&lt;/p&gt;
